import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Navbar: React.FC = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav className="navbar">
      <div className="navbar-content">
        <Link to="/" className="logo">
          <span className="desktop-only">üèàüèÄ ROCK SPORTS</span>
          <span className="mobile-only">üèàüèÄ ROCK</span>
        </Link>
        
        <div className="nav-links">
          {user ? (
            <>
              <Link to="/dashboard" className="nav-link">
                <span className="desktop-only">üè† Dashboard</span>
                <span className="mobile-only">üè†</span>
              </Link>
              {user.role !== 'admin' && (
                <>
                  <Link to="/sports" className="nav-link">
                    <span className="desktop-only">üèàüèÄ Live Sports</span>
                    <span className="mobile-only">üèàüèÄ</span>
                  </Link>
                  <Link to="/basketball" className="nav-link">
                    <span className="desktop-only">üèÄ NBA</span>
                    <span className="mobile-only">üèÄ</span>
                  </Link>
                  <Link to="/betting" className="nav-link">
                    <span className="desktop-only">üéØ Place Bet</span>
                    <span className="mobile-only">üéØ</span>
                  </Link>
                  <Link to="/history" className="nav-link">
                    <span className="desktop-only">üìä History</span>
                    <span className="mobile-only">üìä</span>
                  </Link>
                </>
              )}
              {user.role === 'admin' && (
                <Link to="/admin" className="nav-link">
                  <span className="desktop-only">üè¶ Admin</span>
                  <span className="mobile-only">üè¶</span>
                </Link>
              )}
              <div className="credits">
                {user.role === 'admin' ? (
                  <>
                    <span className="desktop-only">üëë Admin</span>
                    <span className="mobile-only">üëë</span>
                  </>
                ) : (
                  <>
                    <span className="desktop-only">üí∞ ${user.credits.toFixed(2)}</span>
                    <span className="mobile-only">üí∞ ${user.credits.toFixed(0)}</span>
                  </>
                )}
              </div>
              <button onClick={handleLogout} className="btn btn-danger" style={{ padding: '8px 12px', fontSize: '12px' }}>
                <span className="desktop-only">üö™ Logout</span>
                <span className="mobile-only">üö™</span>
              </button>
            </>
          ) : (
            <>
              <Link to="/login" className="nav-link">üîë Login</Link>
              <Link to="/register" className="nav-link">üöÄ Register</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
